import styled from "styled-components";

const HeaderStyled = styled.header`
  display: flex;
  align-items: center;
  justify-content: space-around;
  max-width: 1150px;
  width: 100%;
  position: sticky;
  top: 0;
  background-color: #f5f6fa;
  height: 4em;
  min-height: 4em;
`;

export default HeaderStyled;
